void selectionSort(int arr[],int size)
{
    int i,j;
    int min;
    for(i=0;i<size;i++)
        {
            min=i;
            for(j=i;j<size;j++)
                {
                    if(arr[j]<arr[min])
                        {
                            min=j;
                        }
                }
            int temp= arr[i];
            arr[i]=arr[min];
            arr[min]=temp;
        }
}




